import "../Components/style/Navbar.css"
import React, { useState } from 'react'

function Navbar() {
    const[navActive,setNavActive]=useState(false);
    const toggleNav=()=>{
        setNavActive(!navActive)
    }
    return (
        <>
        <nav className="navbar"></nav>
        </>
    )
}

export default Navbar
